import React from 'react';
import './App.css';
import Timestamps from './components/timestamps';
import Metrics from './components/metrics'
function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <Timestamps />
      <Metrics />
    </div>
  );
}

export default App;
